<link type="text/css" rel="stylesheet" href="css/perfil.css"/>
<div ng-show="!user.id" class="progress white">
    <div class="indeterminate"></div>
</div>
<div class="col s12 m12 l12" ng-show="user.id">
    <div id="profile-card" class="card">
        <a class="card-image waves-effect waves-block waves-light">
            <img class="activator" src="data:image/jpeg;base64," alt="user background">
        </a>
        <div class="card-content">
            <div class="card-face__avatar">
                <img src="{{user.imagen}}" alt="" class="circle responsive-img activator card-profile-image">

                <a class="btn-floating activator btn-move-up waves-effect waves-light darken-2 right">
                    <i class="mdi-action-account-circle"></i>
                </a>
                <a href="/{{user.url}}/perfil" class="btn-floating btn-move-up waves-effect waves-light red right">
                    <i class="mdi-action-visibility"></i>
                </a>
            </div>
            <span class="card-title grey-text text-darken-4">{{ user.nombre + ' ' + user.apellidos | capitalize:true }}</span>
            <div class="card-face__social">
                <p><i class="mdi-action-perm-identity cyan-text text-darken-2"></i> Project Manager</p>
                <p><i class="mdi-action-perm-phone-msg cyan-text text-darken-2"></i> +1 (612) 222 8989</p>
                <p><i class="mdi-communication-email cyan-text text-darken-2"></i> mail@domain.com</p>
            </div>

        </div>
        <div class="card-reveal">
            <span class="card-title grey-text text-darken-4">{{ user.nombre + ' ' + user.apellidos | capitalize:true }} <i class="mdi-navigation-close right"></i></span>
            <p>Here is some more information about this card.</p>
            <p><i class="mdi-action-perm-identity cyan-text text-darken-2"></i> Project Manager</p>
            <p><i class="mdi-action-perm-phone-msg cyan-text text-darken-2"></i> +1 (612) 222 8989</p>
            <p><i class="mdi-communication-email cyan-text text-darken-2"></i> {{user.email}}</p>
            <p><i class="mdi-social-cake cyan-text text-darken-2"></i> {{user.fecha.toDateString()}}</p>
            <p><i class="mdi-device-airplanemode-on cyan-text text-darken-2"></i> BAR - AUS</p>
        </div>
    </div>
</div>
<div  ng-show="!user.id" class="row waves-light darken-2 center-align">
    <div class="waves-effect waves-light">
        <i class="mdi-action-face-unlock large"></i>
    </div>
    <h3>Este perfil no existe</h3> 

</div>